class Solution {
public:
    int longestSquareStreak(vector<int> &nums)
    {
        sort(nums.begin(), nums.end());
        array<int, 100004> counts;
        counts.fill(0);
        int result = 0;
        int i = 0;
        int last = 0;
        for (; i < nums.size() && nums[i] <= 316; ++i) {
            int n = nums[i];
            if (last == n) continue;
            result = max(result, counts[n] + 1);
            counts[n * n] = counts[n] + 1;
            last = n;
        }
        for (; i < nums.size(); ++i) {
            result = max(result, counts[nums[i]] + 1);
        }

        if (result < 2) return -1;
        return result;
    }
};

class Solution2 {
public:
    int longestSquareStreak(vector<int> &nums)
    {
        vector<int> counts(nums.size());
        sort(nums.begin(), nums.end());
        int result = 0;
        int last = 0;
        for (auto it = nums.begin(); it != nums.end(); ++it) {
            if (last == *it) continue;
            if (*it > 316) {
                result = max(result, counts[it - nums.begin()] + 1);
                continue;
            }
            auto x = (*it) * (*it);
            auto jt = lower_bound(it, nums.end(), x);
            if (jt != nums.end() && (x == *jt)) {
                counts[jt - nums.begin()] = counts[it - nums.begin()] + 1;
            } else {
                result = max(result, counts[it - nums.begin()] + 1);
            }
            last = *it;
        }
        if (result < 2) return -1;
        return result;
    }
};

class Solution3 {
public:
    int longestSquareStreak(vector<int> &nums)
    {
        int n = nums.size();
        vector<int> counts(n);
        sort(nums.begin(), nums.end());

        int result = 0;
        int last = 0;
        for (int i = 0; i < n; ++i) {
            if (last == nums[i]) continue;
            result = max(result, counts[i] + 1);
            if (nums[i] >= 1000) {
                continue;
            }
            int x = nums[i] * nums[i];
            auto it = lower_bound(nums.begin(), nums.end(), x);
            if (it != nums.end() && *it == x) {
                counts[it - nums.begin()] = counts[i] + 1;
            }
            last = nums[i];
        }
        if (result < 2) return -1;
        return result;
    }
};

